import * as React from "react";
import "./Matching.css";
import profile from "../../Images/Avatar7.png";
import Navbars from "../Navbar/navbarHome2.js";
import DrawerInHome from "../Drawer/DrawerCustomer";
import { createOrder } from "../../slices/auth";
import { FaUserCircle } from "react-icons/fa";
import {
  FaLanguage,
  FaFile,
  FaLongArrowAltLeft,
  FaLongArrowAltRight,
} from "react-icons/fa";

import {
  IconButton,
  Input,
  Box,
  Autocomplete,
  TextField,
  Stack,
  Rating,
  Modal,
  Typography,
} from "@mui/material";
import { data } from "../Data/data";
import { useNavigate, useLocation } from "react-router-dom";
// import moment from "moment";
import { MdArrowDropDown } from "react-icons/md";

import {
  Translate02EN,
  Translate02DE,
  Translate02TH,
  CustomerEN,
  CustomerDE,
  CustomerTH,
  Translate01EN,
  Translate01TH,
  Translate01DE,
} from "../Data/DataLanguage";

import axios from "axios";
import { useDispatch, useSelector } from "react-redux";

const Matching = () => {
  const navigate = useNavigate();
  const location = useLocation();
  const [languages, setLanguages] = React.useState("");
  const [languages2, setLanguages2] = React.useState("");
  const [page, setPage] = React.useState("Text");
  const [findA_Translator, setFindA_Translator] = React.useState("Translate");
  const [textarea, setTextarea] = React.useState("");
  const [images, setImages] = React.useState([]);
  const [open, setOpen] = React.useState(false);
  const [trantype, setTranstype] = React.useState("");
  const [translator, setTtranslator] = React.useState("");

  // logic login
  const dispatch = useDispatch();
  const auth = useSelector((state) => state.auth);
  const Doc = location?.state?.name;
  let value = auth?.token;
  let Toc = location?.state?.languages;
  // const url = "https://54.244.204.59/api";
  const url = "http://localhost:3001/api";


  //logic createOrder
  const formattedDate = new Date();
  // const [order, setOrder] = React.useState({
  //   Date: formattedDate,
  //   Translator_name: "",
  //   Customer_name: auth?.name,
  //   Customers_will_get: "",
  //   Job_description: "",
  //   Deadline: "",
  //   Number_of_edits: "",
  //   Price: "",
  //   Status: "",
  //   Send_to: "",
  //   Review: "",
  //   Order_type: "General Document",
  // });

  console.log("images :", typeof images);

  React.useEffect(() => {
    if (value) {
      console.log("auth", auth);
    } else {
      navigate("/Login");
    }
  }, [value]);

  // const Time = moment(new Date()).format("h:mm:ss");
  // const Day = moment(new Date()).format("DD MMM YYYY");

  const handleChange = (event) => {
    setTextarea(event.target.value);
  };
  const switchLanguage = () => {
    setLanguages(languages2);
    setLanguages2(languages);
  };

  function onImageChange(e) {
    setImages(URL.createObjectURL(e.target.files[0]));
  }
  const find_Translator = () => {
    setFindA_Translator("Find_ATranslator");
    // setTranstype("")
    window.scroll(0, 0);
  };

  const Cancle = () => {
    setTranstype("");
    setLanguages("");
    setLanguages2("");
    setTextarea("");
    window.scroll(0, 0);
  };

  // const handleOpen = () => setOpen(true);
  const handleClose = () => setOpen(false);

  const fathdata = async () => {
    const token2 = await axios.get(`${url}/getUsers`, {});
    console.log("data:", token2?.data);

    const translators = token2?.data?.filter(
      (translator) => translator.type === "translators"
    );
    setTtranslator(translators);
    // setAllUser(token2?.data);
  };

  // console.log("translators:", translator);

  //logic createOrder
  const DealTransalator = async (i) => {
    try {
      console.log(i);
      await dispatch(createOrder(i));
    } catch (error) {
      await console.log(error);
    }
    await navigate("/Chat", {
      state: {
        languages: `${languages}`,
        value: `${value}`,
        name: `${i?.Translator_name}`,
      },
    });
  };

  const setData = (i) => {
    const data = {
      Date: formattedDate,
      Translator_name: i,
      Customer_name: auth?.name,
      Customers_will_get: "",
      Job_description: "",
      Deadline: "",
      Number_of_edits: "",
      Price: "",
      Status: "0",
      Send_to: "",
      Review: "",
      Order_type: "General Document",
    };
    DealTransalator(data);
  };

  React.useEffect(() => {
    fathdata();
  }, []);
  return (
    <div className="App-body-Order">
      <header className="App-header">
        {Toc === "English" ? (
          <Navbars
            navigate={navigate}
            languages="English"
            dispatch={dispatch}
          />
        ) : Toc === "Thai" ? (
          <Navbars navigate={navigate} languages="Thai" dispatch={dispatch} />
        ) : Toc === "German" ? (
          <Navbars navigate={navigate} languages="German" dispatch={dispatch} />
        ) : (
          <Navbars
            navigate={navigate}
            languages="English"
            dispatch={dispatch}
          />
        )}
      </header>
      <Box sx={{ display: "flex", width: "100% " }}>
        <DrawerInHome languages={Toc} value={value} />

        <div className="mainMatching">
          <>
            {findA_Translator === "Translate" ? (
              <>
                <div style={{ marginTop: 60, height: 100 }}>
                  <h4
                    style={{
                      fontWeight: 500,
                      fontSize: 26,
                      color: " #034D82",
                      marginLeft: 20,
                      position: "absolute",
                      top: "13%",
                    }}
                  >
                    {Translate02EN[0].label}
                  </h4>
                </div>

                {page === "Text" ? (
                  <div className="bodyMatching">
                    <div style={{ margin: 30 }}>
                      <div>
                        {Doc === undefined ? (
                          <>
                            {trantype === "" ? (
                              <Autocomplete
                                id="country-select-demo"
                                sx={{ width: 260 }}
                                options={Translate01EN}
                                autoHighlight
                                getOptionLabel={(option) => option.label}
                                onChange={(event, value) =>
                                  setTranstype(value.label)
                                }
                                popupIcon={
                                  <MdArrowDropDown
                                    style={{
                                      color: "#333333",
                                      width: 30,
                                      height: 33,
                                    }}
                                  />
                                }
                                renderOption={(props, option) => (
                                  <Box
                                    component="li"
                                    sx={{ "& > img": { mr: 2, flexShrink: 0 } }}
                                    {...props}
                                  >
                                    {option.label}
                                  </Box>
                                )}
                                renderInput={(params) => (
                                  <TextField
                                    {...params}
                                    label={CustomerEN[9].label}
                                    inputProps={{
                                      ...params.inputProps,
                                      autoComplete: "new-password",
                                    }}
                                  />
                                )}
                              />
                            ) : (
                              <p
                                style={{
                                  textAlign: "start",
                                  color: "#034D82",
                                  fontWeight: 600,
                                  fontSize: 24,
                                }}
                              >
                                {trantype}
                              </p>
                            )}
                          </>
                        ) : (
                          <p
                            style={{
                              textAlign: "start",
                              color: "#034D82",
                              fontWeight: 600,
                              fontSize: 24,
                            }}
                          >
                            {Doc}
                          </p>
                        )}
                        <div style={{ textAlign: "start" }}>
                          <button
                            className="buttonMatching1"
                            onClick={() => setPage("Text")}
                          >
                            <FaLanguage className="iconsMatching" />
                            <p className="textMatching">
                              {Translate02EN[1].label}
                            </p>
                          </button>
                          <button
                            className="buttonMatching"
                            onClick={() => setPage("File")}
                          >
                            <FaFile className="iconsMatching" />
                            <p className="textMatching">
                              {Translate02EN[2].label}
                            </p>
                          </button>
                        </div>

                        <div style={{ float: "left" }}>
                          <p
                            style={{
                              textAlign: "start",
                              color: "#353535",
                              fontSize: 18,
                              marginBottom: 20,
                            }}
                          >
                            {Translate02EN[3].label}
                          </p>
                          <Autocomplete
                            disablePortal
                            id="combo-box-demo"
                            options={data}
                            sx={{ width: 582 }}
                            renderInput={(params) => (
                              <TextField
                                {...params}
                                label={Translate02EN[3].label}
                              />
                            )}
                            isOptionEqualToValue={(option, value) =>
                              option.code === value
                            }
                            value={languages}
                            onChange={(event, value) =>
                              setLanguages(value?.label)
                            }
                          />
                        </div>

                        <button
                          style={{
                            float: "left",
                            width: 30,
                            top: 60,
                            position: "relative",
                            fontSize: 30,
                            marginLeft: 20,
                            marginRight: 20,
                            background: "transparent",
                            border: "none",
                            color: "#262DBB",
                          }}
                          onClick={() => switchLanguage()}
                        >
                          <FaLongArrowAltRight
                            style={{ position: "absolute" }}
                          />

                          <FaLongArrowAltLeft
                            style={{ position: "relative" }}
                          />
                        </button>

                        <div style={{ float: "left" }}>
                          <p
                            style={{
                              textAlign: "start",
                              color: "#353535",
                              fontSize: 18,
                              marginBottom: 20,
                            }}
                          >
                            {Translate02EN[3].label}
                          </p>
                          <Autocomplete
                            disablePortal
                            id="combo-box-demo"
                            options={data}
                            sx={{ width: 582 }}
                            renderInput={(params) => (
                              <TextField
                                {...params}
                                label={Translate02EN[3].label}
                              />
                            )}
                            isOptionEqualToValue={(option, value) =>
                              option.code === value
                            }
                            value={languages2}
                            onChange={(event, value) =>
                              setLanguages2(value?.label)
                            }
                          />
                        </div>

                        <div>
                          <textarea
                            value={textarea}
                            onChange={handleChange}
                            maxLength={350}
                            style={{
                              position: "relative",
                              width: "100%",
                              height: 300,
                              background: "#FFFFFF",
                              border: "1px solid #E5E5E5",
                              boxSizing: "border-box",
                              borderRadius: 5,
                              padding: 20,
                              top: 30,
                              fontSize: 25,
                            }}
                            placeholder={Translate02EN[1].label}
                          />
                        </div>

                        <div style={{ marginTop: 38 }}>
                          <div style={{ float: "left" }}>
                            <button
                              style={{
                                width: 100,
                                height: 40,
                                background: "transparent",
                                color: "#CF0202",
                                border: "1px solid #CF0202",
                                borderRadius: 5,
                              }}
                              onClick={() => Cancle()}
                            >
                              {Translate02EN[4].label}
                            </button>
                          </div>
                          <div style={{ textAlign: "end" }}>
                            <button
                              style={{
                                width: 200,
                                height: 40,
                                background: "#047ACF",
                                color: "#FFFFFF",
                                border: "none",
                                borderRadius: 5,
                              }}
                              onClick={() => find_Translator()}
                            >
                              {Translate02EN[5].label}
                            </button>
                          </div>
                        </div>
                      </div>
                    </div>
                  </div>
                ) : (
                  <div className="bodyMatching2">
                    <div style={{ margin: 30 }}>
                      <div>
                        <div className="BoxFileMatching">
                          <div>
                            <div
                              style={{
                                height: 50,
                                // marginTop: 100,
                                textAlign: "center",
                              }}
                            >
                              {images.length < 1 ? (
                                <div>
                                  <p
                                    style={{
                                      fontSize: 20,
                                      fontWeight: 800,
                                      marginBottom: 20,
                                    }}
                                  >
                                    {Translate02EN[6].label}
                                  </p>
                                  <p
                                    style={{
                                      fontSize: 20,
                                      fontWeight: 800,
                                      marginBottom: 20,
                                    }}
                                  >
                                    {Translate02EN[7].label}
                                  </p>
                                  <div
                                    style={{
                                      position: "relative",
                                      borderColor: "#0865A8",
                                      borderWidth: 2,
                                      margin: 25,
                                      left: "20%",
                                      width: 200,
                                      height: 40,
                                      background: "#047ACF",
                                      color: "#FFFFFF",
                                      border: "none",
                                      borderRadius: 5,
                                      textAlign: "center",
                                    }}
                                  >
                                    <label htmlFor="icon-button-file">
                                      <Input
                                        accept="image/*"
                                        id="icon-button-file"
                                        type="file"
                                        style={{ display: "none" }}
                                        onChange={onImageChange}
                                      />
                                      <IconButton
                                        color="primary"
                                        aria-label="upload picture"
                                        component="span"
                                      >
                                        <p
                                          style={{
                                            fontSize: 18,
                                            color: "#FFFF",
                                            position: "relative",
                                          }}
                                        >
                                          {Translate02EN[8].label}
                                        </p>
                                      </IconButton>
                                    </label>
                                  </div>
                                </div>
                              ) : (
                                <div
                                  style={{
                                    borderRadius: 100,
                                    width: 100,
                                    height: 100,
                                    position: "relative",
                                    borderWidth: 2,
                                    // margin: 25,
                                    // left: "30%",
                                    fontSize: 18,
                                  }}
                                >
                                  {/* set images */}
                                  <label htmlFor="icon-button-file">
                                    <Input
                                      accept="image/*"
                                      id="icon-button-file"
                                      type="file"
                                      style={{ display: "none" }}
                                      onChange={onImageChange}
                                    />
                                    <IconButton
                                      color="primary"
                                      aria-label="upload picture"
                                      component="span"
                                    >
                                      {images && (
                                        <img
                                          src={images}
                                          alt="Preview"
                                          style={{
                                            width: " 33vw",
                                            height: "33vw",
                                          }}
                                        />
                                      )}
                                    </IconButton>
                                  </label>
                                </div>
                              )}
                            </div>
                          </div>

                          <div style={{ width: 710 }}>
                            {Doc === undefined ? (
                              <>
                                {trantype === "" ? (
                                  <Autocomplete
                                    id="country-select-demo"
                                    sx={{ width: 260 }}
                                    options={Translate01EN}
                                    autoHighlight
                                    getOptionLabel={(option) => option.label}
                                    onChange={(event, value) =>
                                      setTranstype(value.label)
                                    }
                                    popupIcon={
                                      <MdArrowDropDown
                                        style={{
                                          color: "#333333",
                                          width: 30,
                                          height: 33,
                                        }}
                                      />
                                    }
                                    renderOption={(props, option) => (
                                      <Box
                                        component="li"
                                        sx={{
                                          "& > img": { mr: 2, flexShrink: 0 },
                                        }}
                                        {...props}
                                      >
                                        {option.label}
                                      </Box>
                                    )}
                                    renderInput={(params) => (
                                      <TextField
                                        {...params}
                                        label={CustomerEN[9].label}
                                        inputProps={{
                                          ...params.inputProps,
                                          autoComplete: "new-password",
                                        }}
                                      />
                                    )}
                                  />
                                ) : (
                                  <p
                                    style={{
                                      textAlign: "start",
                                      color: "#034D82",
                                      fontWeight: 600,
                                      fontSize: 24,
                                    }}
                                  >
                                    {trantype}
                                  </p>
                                )}
                              </>
                            ) : (
                              <p
                                style={{
                                  textAlign: "start",
                                  color: "#034D82",
                                  fontWeight: 600,
                                  fontSize: 24,
                                }}
                              >
                                {Doc}
                              </p>
                            )}
                            {/* button set page === "Text" || images  */}
                            <div style={{ textAlign: "start" }}>
                              <button
                                className="buttonMatching"
                                onClick={() => setPage("Text")}
                              >
                                <FaLanguage className="iconsMatching" />
                                <p className="textMatching">
                                  {Translate02EN[1].label}
                                </p>
                              </button>
                              <button
                                className="buttonMatching1"
                                onClick={() => setPage("File")}
                              >
                                <FaFile className="iconsMatching" />
                                <p className="textMatching">
                                  {Translate02EN[2].label}
                                </p>
                              </button>
                            </div>
                            <div className="languagestolanguages2">
                              <div style={{ float: "left" }}>
                                <p
                                  style={{
                                    textAlign: "start",
                                    color: "#353535",
                                    fontSize: 18,
                                    marginBottom: 20,
                                  }}
                                >
                                  {Translate02EN[3].label}
                                </p>
                                <Autocomplete
                                  disablePortal
                                  id="combo-box-demo"
                                  options={data}
                                  sx={{ width: 320 }}
                                  renderInput={(params) => (
                                    <TextField
                                      {...params}
                                      label={Translate02EN[3].label}
                                    />
                                  )}
                                  isOptionEqualToValue={(option, value) =>
                                    option.code === value
                                  }
                                  value={languages}
                                  onChange={(event, value) =>
                                    setLanguages(value?.label)
                                  }
                                />
                              </div>

                              <button
                                style={{
                                  float: "left",
                                  width: 30,
                                  top: 25,
                                  position: "relative",
                                  fontSize: 30,
                                  marginLeft: 20,
                                  marginRight: 20,
                                  background: "transparent",
                                  border: "none",
                                  color: "#262DBB",
                                }}
                                onClick={() => switchLanguage()}
                              >
                                <FaLongArrowAltRight
                                  style={{ position: "absolute" }}
                                />

                                <FaLongArrowAltLeft
                                  style={{ position: "relative" }}
                                />
                              </button>

                              <div style={{ float: "left" }}>
                                <p
                                  style={{
                                    textAlign: "start",
                                    color: "#353535",
                                    fontSize: 18,
                                    marginBottom: 20,
                                  }}
                                >
                                  {Translate02EN[3].label}
                                </p>
                                <Autocomplete
                                  disablePortal
                                  id="combo-box-demo"
                                  options={data}
                                  sx={{ width: 320 }}
                                  renderInput={(params) => (
                                    <TextField
                                      {...params}
                                      label={Translate02EN[3].label}
                                    />
                                  )}
                                  isOptionEqualToValue={(option, value) =>
                                    option.code === value
                                  }
                                  value={languages2}
                                  onChange={(event, value) =>
                                    setLanguages2(value?.label)
                                  }
                                />
                              </div>
                            </div>
                            <div>
                              <textarea
                                value={textarea}
                                onChange={handleChange}
                                maxLength={350}
                                style={{
                                  position: "relative",
                                  width: "100%",
                                  height: 230,
                                  background: "#FFFFFF",
                                  border: "1px solid #E5E5E5",
                                  boxSizing: "border-box",
                                  borderRadius: 5,
                                  padding: 20,
                                  top: 30,
                                  fontSize: 20,
                                }}
                                placeholder={Translate02EN[1].label}
                              />
                            </div>
                          </div>
                        </div>

                        <div style={{ marginTop: "5%" }}>
                          <div style={{ float: "left" }}>
                            <button
                              style={{
                                width: 100,
                                height: 40,
                                background: "transparent",
                                color: "#CF0202",
                                border: "1px solid #CF0202",
                                borderRadius: 5,
                              }}
                              onClick={() => Cancle()}
                            >
                              {Translate02EN[4].label}
                            </button>
                          </div>
                          <div style={{ textAlign: "end" }}>
                            <button
                              style={{
                                width: 200,
                                height: 40,
                                background: "#047ACF",
                                color: "#FFFFFF",
                                border: "none",
                                borderRadius: 5,
                              }}
                              onClick={() => find_Translator()}
                            >
                              {Translate02EN[5].label}
                            </button>
                          </div>
                        </div>
                      </div>
                    </div>
                  </div>
                )}
              </>
            ) : (
              <div>
                <div className="BoxFrame2">
                  <div className="Find_a_translatorFrame2 ">
                    <h4
                      style={{
                        fontWeight: 500,
                        fontSize: 26,
                        color: " #034D82",
                      }}
                    >
                      {Translate02EN[5].label}
                    </h4>
                    <div className="bodyMatchingFind">
                      <div>
                        <div>
                          {Doc === undefined ? (
                            <p className="Doctype">{trantype}</p>
                          ) : (
                            <p className="Doctype">{Doc}</p>
                          )}
                        </div>

                        <div className="languagestolanguages">
                          <p
                            style={{
                              textAlign: "start",
                              color: "#034D82",
                              fontWeight: 600,
                              fontSize: 17,
                              marginTop: 10,
                              float: "left",
                            }}
                          >
                            {Translate02EN[3].label} :
                          </p>

                          <div>
                            {languages === "English" ? (
                              <p
                                style={{
                                  textAlign: "start",
                                  color: "#353535",
                                  fontWeight: 600,
                                  fontSize: 17,
                                  marginTop: 10,
                                }}
                              >
                                EN
                              </p>
                            ) : languages === "German" ? (
                              <p
                                style={{
                                  textAlign: "start",
                                  color: "#353535",
                                  fontWeight: 600,
                                  fontSize: 17,
                                  marginTop: 10,
                                }}
                              >
                                DE
                              </p>
                            ) : languages === "Thai" ? (
                              <p
                                style={{
                                  textAlign: "start",
                                  color: "#353535",
                                  fontWeight: 600,
                                  fontSize: 17,
                                  marginTop: 10,
                                }}
                              >
                                TH
                              </p>
                            ) : null}
                          </div>

                          <div>
                            <p
                              style={{
                                float: "left",
                                width: 15,
                                top: 12,
                                position: "relative",
                                fontSize: 18,
                                background: "transparent",
                                border: "none",
                                color: "#353535",
                              }}
                              onClick={() => switchLanguage()}
                            >
                              <FaLongArrowAltRight
                                style={{ position: "absolute" }}
                              />

                              <FaLongArrowAltLeft
                                style={{ position: "relative" }}
                              />
                            </p>
                          </div>

                          <div>
                            {languages2 === "English" ? (
